import React, { useEffect } from 'react'
import "./Home.css";
import * as THREE from 'three';
import {OrbitControls} from "three/examples/jsm/controls/OrbitControls"   //controller
import moonimage from "../../images/moon.jpg";
import venusimage from "../../images/venus.jpg";
import spaceimage from "../../images/space.jpg";
import {Typography} from "@mui/material";    //By default roboto font family 
import TimeLine from "../TimeLine/TimeLine.jsx";
import {
  SiCplusplus,    //icons
  SiReact,
  SiJavascript,
  SiMongodb,
  SiNodedotjs,
  SiExpress,
  SiCss3,
  SiHtml5,
  SiThreedotjs,
} from "react-icons/si";
import { Link } from "react-router-dom";
import { MouseOutlined } from "@mui/icons-material";

const Home = ({ timelines, youtubes, skills }) => {
  useEffect(()=>{

    const textureLoader = new THREE.TextureLoader();

    const moonTexture = textureLoader.load(moonimage);
    const venusTexture = textureLoader.load(venusimage);
    const spaceTexture = textureLoader.load(spaceimage);
  
   const scene=new THREE.Scene();   //until we set co-ordinates all takes 0,0,0 default ones
   const camera = new THREE.PerspectiveCamera( 75, window.innerWidth / window.innerHeight, 0.1, 1000 );
   const canvas=document.querySelector(".homecanvas")
   const renderer=new THREE.WebGLRenderer({canvas})
   camera.position.set(4, 4, 8);

   const moongeometry=new THREE.SphereGeometry(2,64,64);  //html type
   const moonmaterial=new THREE.MeshStandardMaterial({map:moonTexture});   //css type  standard type for light effect
   const moon=new THREE.Mesh(moongeometry,moonmaterial); 

   const venusGeometry = new THREE.SphereGeometry(3, 64, 64);
   const venusMaterial = new THREE.MeshBasicMaterial({ map: venusTexture });
   const venus = new THREE.Mesh(venusGeometry, venusMaterial);
   venus.position.set(8, 5, 5);  //(x,y,z)
   
   const pointLight = new THREE.PointLight(0xffffff,100);   //torch (color,intensity)
   pointLight.position.set(8,5,5);

   const pointLight2 = new THREE.PointLight(0xffffff,10);
   pointLight2.position.set(-8,-5,-5);

  //  const controls=new OrbitControls(camera,renderer.domElement)     //to control rotation
  //  const lighthelper=new THREE.PointLightHelper(pointLight)
   scene.add(moon);
   scene.add(pointLight);
   scene.add(pointLight2);
  //  scene.add(lighthelper);
   scene.add(venus);
   scene.background = spaceTexture;

   const speed = 0.01;
   window.addEventListener("mousemove",(e)=>{   //dividing screen into 2 parts 
      if(e.clientX <= window.innerWidth/2){        //left part
        moon.rotation.x +=speed;
        moon.rotation.y += speed;
        venus.rotation.x -= speed;
        venus.rotation.y += speed;
      }
      if (e.clientX > window.innerWidth / 2) {
        moon.rotation.x -= speed;
        moon.rotation.y -= speed;
        venus.rotation.x -= speed;
        venus.rotation.y -= speed;
      }

      if (e.clientY > window.innerHeight / 2) {
        moon.rotation.x -= speed;
        moon.rotation.y += speed;
        venus.rotation.x -= speed;
        venus.rotation.y += speed;
      }

      if (e.clientY <= window.innerHeight / 2) {
        moon.rotation.x -= speed;
        moon.rotation.y -= speed;
        venus.rotation.x -= speed;
        venus.rotation.y -= speed;
      }
   });

   camera.position.z=10;  //z axis, like camera zoom out=10x 
   const animate=()=>{   //recursion function for animation
      requestAnimationFrame(animate);
      moon.rotation.y+=0.01; 
      renderer.setSize(window.innerWidth , window.innerHeight);
      renderer.render(scene,camera);
      }
      animate();
      
      return window.addEventListener("scroll", () => {
        camera.rotation.z = window.scrollY * 0.001;
        camera.rotation.y = window.scrollY * 0.003;
  
        const skillsBox = document.getElementById("homeskillsBox");
  
        if (window.scrollY > 1500) {
          skillsBox.style.animationName = "homeskillsBoxAnimationOn";
        } else {
          skillsBox.style.animationName = "homeskillsBoxAnimationOff";
        }
      });
      
  },[])
  return (
    <div className='home'>
      <canvas className='homecanvas'></canvas>

      <div className="homeCanvasContainer">
        <Typography variant="h1">
          <p>S</p>
          <p>H</p>
          <p>I</p>
          <p>V</p>
          <p>A</p>
          <p>R</p>
          <p>A</p>
          <p>J</p>
        </Typography>

        <div className="homeCanvasBox">
          <Typography variant="h2">DESIGNER</Typography>
          <Typography variant="h2">DEVELOPER</Typography>
          <Typography variant="h2">STUDENT</Typography>
          <Typography variant="h2">PROGRAMMER</Typography>
        </div>

        <Link to="/projects">VIEW WORK</Link>
      </div>

      <div className="homeScrollBtn">
        <MouseOutlined />
      </div>

      <div className="homecont">
        <Typography variant="h3">TIMELINE</Typography>
        <TimeLine timelines={timelines}/>
      </div>
      <div className="homeskills">
      <Typography variant="h3">Skills</Typography>
      {/* <div className="homeCubeSkills">
      <div className="homeCubeSkillsFaces homeCubeSkillsFace1">
            <img src={skills.image1.url} alt="Face1" />
          </div>

          <div className="homeCubeSkillsFaces homeCubeSkillsFace2">
            <img src="data:image/jpeg;base64," alt="Face2" />
          </div>

          <div className="homeCubeSkillsFaces homeCubeSkillsFace3">
            <img src="data:image/jpeg;base64," alt="Face3" />
          </div>

          <div className="homeCubeSkillsFaces homeCubeSkillsFace4">
            <img src="data:image/jpeg;base64," alt="Face4" />
          </div>

          <div className="homeCubeSkillsFaces homeCubeSkillsFace5">
            <img src="data:image/jpeg;base64,"alt="Face5" />
          </div>

          <div className="homeCubeSkillsFaces homeCubeSkillsFace6">
            <img src="data:image/jpeg;base64,"alt="Face6" />
          </div>
      </div> */}
      <div className="homeCubeSkills">
  {skills && (
    <>
      <div className="homeCubeSkillsFaces homeCubeSkillsFace1">
        {skills.image1 && <img src={skills.image1.url} alt="Face1" />}
      </div>

      <div className="homeCubeSkillsFaces homeCubeSkillsFace2">
        {skills.image2 && <img src={skills.image2.url} alt="Face2" />}
      </div>

      <div className="homeCubeSkillsFaces homeCubeSkillsFace3">
        {skills.image3 && <img src={skills.image3.url} alt="Face3" />}
      </div>

      <div className="homeCubeSkillsFaces homeCubeSkillsFace4">
        {skills.image4 && <img src={skills.image4.url} alt="Face4" />}
      </div>

      <div className="homeCubeSkillsFaces homeCubeSkillsFace5">
        {skills.image5 && <img src={skills.image5.url} alt="Face5" />}
      </div>

      <div className="homeCubeSkillsFaces homeCubeSkillsFace6">
        {skills.image6 && <img src={skills.image6.url} alt="Face6" />}
      </div>
    </>
  )}
</div>

      <div className="cubeShadow"></div>
      <div className="homeskillsBox" id="homeskillsBox">
          <SiCplusplus />
          <SiHtml5 />
          <SiCss3 />
          <SiJavascript />
          <SiMongodb />
          <SiExpress />
          <SiReact />
          <SiNodedotjs />
          <SiThreedotjs />
        </div>
      </div>
    </div>
  );
};

export default Home
